import { useNavigate } from "react-router-dom";
import { useEffect } from "react";

function Logout() {
  const navigate = useNavigate();

  localStorage.removeItem("token");
  useEffect(()=>{
    navigate("/");

  }, navigate)
  return <div>{/* <button onClick={userLogout}>Logout</button> */}</div>;
}

export default Logout;
